    {
        id: 1,
        img: URL('../pictures/scissors3.png'),
        name: 'Scissor Cut And Style',
        price: '40zł'
    },
    {
        id: 2,
        img: URL('../pictures/razor3.png'),
        name: 'Beard Trim With Razor',
        price: '30zł'
    },
    {
        id: 3,
        img: URL('../pictures/both.png'),
        name: 'Scissor Cut + Beard Trim',
        price: '60zł'
